Family Secrets (Tales Of Victorian Lust / Nica Noelle / Sweet Sinner / 2010)

Sweet Sinner's innovative Victorian-era series continues in this volume of interracial love, forbidden lust, and unspeakable secrets. Well-to-do Rayveness falls on hard times when her husband passes away, so she sends her kids Dane and Sammy to stay with former housekeeper Deluxe. But the arrival of the gorgeous young siblings open a Pandora's box of secrets that Sean Michaels must struggle to keep hidden. With beautiful, authentic Victorian era costumes and locations, and some of the hottest interracial sex ever captured on film. Family Secrets is an instant classic.

Rayveness, Dane Cross, Nat Turner, Wolf Hudson, Sean Michaels

